function App() {
  const classes = useStyles();
  return (
    <div className="App">

      <Grid container justify='center'>  

        <Grid item> 
          <Titulo/>
        </Grid>  

        <Grid container direction='column' justify='center'>

          <Grid item>
            <Paper className={classes.paper}>
              <h3>
              Acesse o Matrícula Web, ou Clique no Link para ser Redirecionado.
              </h3>
            </Paper>
          </Grid>

          <Grid item>
            <MwLink/>
          </Grid>

        </Grid>
     </Grid>

    </div>
  );
}

export default App;
